using System.Drawing;
using System.Drawing.Imaging;
using System.IO;

namespace GoldBoxExplorer.Lib.Plugins.Dax
{
    public class EgaBlock : RenderBlock
    {
        private uint[] EgaColors;
        private bool isCombatPicture = false; // images used in combat mode have a slightly different EGA palette (colors 0 and 8 are swapped)
        public EgaBlock(FileBlockParameters parameters)
        {
            setBlockId(parameters.Id);
            var data = parameters.Data;
            uint height = ArrayToUshort(data, 0);
            uint width = ArrayToUshort(data, 2);
            uint xPos = ArrayToUshort(data, 4);
            uint yPos = ArrayToUshort(data, 6);
            uint itemCount = data[8];
            var widthPx = width * 8;
            var heightPx = height;
            var xPosPx = xPos * 8;
            var yPosPx = yPos * 8;
            const int egaDataOffset = 17;
            var egaDataSize = height * width * 4;
            EgaColors = EgaVgaPalette.EgaColors;

            var filename = Path.GetFileName(parameters.Name).ToUpper();
            if (filename.Contains("CPIC") || filename.Contains("CHEAD") || filename.Contains("CBODY")
                || filename.Contains("DUNGCOM") || filename.Contains("WILDCOM") || filename.Contains("RANDCOM")
                || filename.Contains("COMSPR"))
            {
                isCombatPicture = true;
                EgaColors = EgaVgaPalette.EgaCombatColors;
            }

            if (data.Length == (egaDataSize * (itemCount + 1)) + egaDataOffset)
            {
                // Death Knights of Krynn
                itemCount += 1;
            }

            if (data.Length == (egaDataSize * itemCount) + egaDataOffset)
            {
                var offset = 0;
                for (var i = 0; i < itemCount; i++, offset += (int)egaDataSize)
                {
                    var bitmap = new Bitmap((int)(widthPx + xPosPx), (int)(heightPx + yPosPx),
                                            PixelFormat.Format16bppArgb1555);
                    for (var y = 0; y < heightPx; y++)
                    {
                        for (var x = 0; x < widthPx; x += 2)
                        {
                            var b = data[egaDataOffset + (y * width * 4) + (x / 2) + offset];
                            var pxX = (int)(x + 0 + xPosPx);
                            var pxY = (int)(y + yPosPx);
                            Color ctest = Color.FromArgb((int)EgaColors[b >> 4]);
                            bitmap.SetPixel(pxX, pxY, Color.FromArgb((int)EgaColors[b >> 4]));
                            bitmap.SetPixel(pxX + 1, pxY, Color.FromArgb((int)EgaColors[b & 0xF]));
                            //System.Console.WriteLine(Color.FromArgb((int)EgaColors[b >> 4]) + " / " + (bitmap.GetPixel(pxX, pxY)) + " / " + ((uint)bitmap.GetPixel(pxX, pxY).ToArgb()));  -- Troubleshooting palette difference
                        }
                    }

                    Bitmaps.Add(bitmap);
                    byte[] tmpData = writeEGABlock(bitmap);
                    //System.Console.WriteLine(parameters.Name);
                    foreach (byte b in tmpData) {
                        //System.Console.Write(b.ToString("X").PadLeft(2, '0'));
                    }
                    System.Console.WriteLine();
                }
            }
        }
        
        
        
        

        //        

        static byte[] writeEGABlock(Bitmap img)
        {

            ushort xPos = 8;
            ushort yPos = 0;

            MemoryStream buf = new MemoryStream();
            // Byte [0] & [1] are height
            buf.Write(UShortToArray((ushort)img.Height), 0, 2);
            // Byte [2] & [3] are width / 8
            buf.Write(UShortToArray((ushort)(img.Width / 8)), 0, 2);
            // Byte [4] & [5] are xpos / 8
            buf.Write(UShortToArray((ushort)(xPos / 8)), 0, 2);
            // Byte [6] & [7] are ypos / 8
            buf.Write(UShortToArray((ushort)(yPos / 8)), 0, 2);

            // Write the number of items in this DAX
            byte itemCount = 1;  // I only need one image per block in the the TITLE.DAX
            buf.Write(new byte[] { itemCount }, 0, 1);

            // Copied these 7 from the original TITLE.DAX - don't know what it is.  Maybe the palette
            buf.Write(new byte[] { 0x0, 0x11, 0x22, 0x13, 0x02, 0x21, 0x23, 0x33 }, 0, 8);

            for (var i = 0; i < itemCount; i++)
            {
                for (var y = yPos; y < img.Height; y++)
                {
                    for (var x = xPos; x < img.Width; x += 2)
                    {
                        // Note: this will not work for images with an odd width, unless GetPixel is smart enough to wrap around, which I doubt
                        Color c1 = img.GetPixel(x, yPos + y);
                        Color c2 = img.GetPixel(x + 1, yPos + y);
                        int px1Color = paletteTranslate(c1);
                        int px2Color = paletteTranslate(c2);

                        

                        // 1st 4 bits is the first pixel's color 
                        // 2nd 4 bits is the second pixel's color
                        // Construct a byte number out of those bits that represent those two pixels
                        byte b = System.Convert.ToByte((px1Color << 4) + px2Color);

                        buf.Write(new byte[] { b }, 0, 1);
                    }
                }
            }

            return buf.ToArray();
        }
        
        static byte[] UShortToArray(ushort shrt) {
            // 16 - bit little endian
            byte secondByte = System.Convert.ToByte(shrt >> 8);   // leftmost two bits
            byte firstByte = System.Convert.ToByte(shrt & 0xFF);   // rightmost two bits
            byte[] data = new byte[2];    
            data[0] = firstByte;    
            data[1] = secondByte;
            return data;
        }

        static byte paletteTranslate(Color c)
        {

            // These are hard-coded colors that I stole from GBE.  They may not match all games
            uint[] EgaColors = new uint[] {
                        4278190080,
                        4278190250,
                        4278233600,
                        4278233770,
                        4289331200,
                        4289331370,
                        4289352960,
                        4289374890,
                        4283782485,
                        4283782655,
                        4283826005,
                        4283826175,
                        4294923605,
                        4294923775,
                        4294967125,
                        4294967295
            };

            for (byte idx = 0; idx < EgaColors.Length; idx++)
            {
                Color palColor = Color.FromArgb((int)EgaColors[idx]);
                // I do not know why this is, but the bitmaps that I have seen that come from GBE have
                // a slight difference in their color.  They seem to be off by 3 in the R,G,B values unless
                // the value is 255 or 0.  Idk what is going on, but I give a little leeway in choosing the
                // color from the image
                if (System.Math.Abs(palColor.R - c.R) <= 3 &&
                    System.Math.Abs(palColor.G - c.G) <= 3 &&
                    System.Math.Abs(palColor.B - c.B) <= 3)
                {
                    return idx;
                }
            }
            throw new System.Exception("Unknown Color " + (uint)c.ToArgb() + " used.");
        }

    }
}